import React from 'react';
import { Nav, NavItem, NavLink } from 'reactstrap';

const Example = (props) => {
  return (
    <div>

      <Nav>
        <NavItem>
          <NavLink href="#"><h1>Back </h1></NavLink>
        </NavItem>
    </Nav>

    </div>
  );
}

export default Example;
